import React from 'react';
import { GoogleMap, LoadScript, Marker } from '@react-google-maps/api';

const containerStyle = {
  width: '400px',
  height: '400px'
};

const defaultCenter = {
  lat: 40.730610,  // Coordinates for New York City
  lng: -73.935242
};

function GeoSpatialMap({ coordinates = defaultCenter }) {
  return (
    <LoadScript googleMapsApiKey="AIzaSyAuNDT3WDS6bqTHVfW563NKP9HIPQ1E2Dc">
      <GoogleMap
        mapContainerStyle={containerStyle}
        center={coordinates}
        zoom={10}
      >
        { /* Child components, like markers, info windows, etc. */ }
        <Marker position={coordinates} />
      </GoogleMap>
    </LoadScript>
  );
}

export default React.memo(GeoSpatialMap);
